
from collections import defaultdict
import datetime
from logging import lastResort
import sys

class Solution:
    def threeSum(self, nums: list[int]) -> list[list[int]]:

        duplicatesDict={}

        numsDict=defaultdict(list)

        for i in range(len(nums)):
            numsDict[nums[i]].append(i)

        returnArr=[]

        lastiNum = sys.maxsize
        lastjNum= sys.maxsize
        for i in range(0, len(nums)):
            first=nums[i]
            for j in range(i+1, len(nums)):
                second=nums[j]

                if first==lastiNum and second==lastjNum:
                    continue
                arrPossibleIdxs = numsDict.get(-(first+second))

                if arrPossibleIdxs is not None:

                    #print("dupStr: " + dupStr + " dict[dupStr] " + str(duplicatesDict.get(dupStr)))

                    for idx in arrPossibleIdxs:

                        if idx != i and idx != j:
                            third=nums[idx]
                            arr=[first, second, third]
                            arr.sort()
                            
                            dupStr=""+str(arr[0])+str(arr[1])+str(arr[2])

                            ##print("dupStr: " + dupStr + " dict[dupStr] " + str(duplicatesDict.get(dupStr)))
                            if duplicatesDict.get(dupStr) is None:
                                returnArr.append(arr)
                                
                                duplicatesDict[dupStr] = True
                            break
                lastjNum=second
            
            lastiNum=first
                
            
        return returnArr


